// "Math.CC.5.NBT.A.3a"
var formatStandard = function(standard) {
	var s = standard.toLowerCase().split(/[\.-]/);
	if (s[2] && s[3] && s[5]) {
		return s[2] + "." + s[3] + "." + s[5];
	} else {
		return "missing standard"
	}
}

var ccMappings = {};

for (var i=0; i<raw.length; i++) {
	var row = raw[i];
	for (var j=3; j<row.length; j++) {
		s = formatStandard(row[j]);
		if (!ccMappings[s]) {
			ccMappings[s] = [];
		}
		ccMappings[s].push({name: row[0], slug: row[2]});
	}
}

JSON.stringify(ccMappings);